FeedPackage.Description:
A .net toaster library for very simple and slightly customizable WPF toaster notifications

Check it out on github: https://github.com/zachatrocity/netoaster

Usage:
var err = new ErrorToaster(MessageText.Text);
err.Show();

//or

var suc = new SuccessToaster(MessageText.Text, "bottomright");
suc.Show();

//or

var warn = new WarningToaster("bottomright");
warn.Show();

A .net toaster library for very simple and slightly customizable toaster notifications

Usage:
ErrorToaster.Toast("My Error Message!");
SuccessToaster.Toast("Success message");
WarningToaster.Toast("Warning message", "bottomright");

You can optionally choose to display the toast in the bottom right by added the parameter "bottomright", more positions and animations to come.
